import RegisterUser from "./RegisterUser";
import RegisterServiceProvider from "./RegisterServiceProvider";
import {Switch, Route, Router} from "react-router";
import { Link } from "react-router-dom";
const RegisterScreen = () => {
    return (
        <Router>
        <Link to="/user_register">
            <button variant="outlined">
                USER
            </button>
        </Link>
    <Link to="/sp_register">
        <button variant="outlined">
            SERVICE PROVIDER
        </button>
    </Link>
        <Switch> {/* The Switch decides which component to show based on the current URL.*/}
            <Route exact path='/user_register' component={RegisterUser}></Route>
            <Route exact path='/sp_register' component={RegisterServiceProvider}/>
        </Switch>
            </Router>
    );
}
export default RegisterScreen;
